"<div>\n<i class=\"NoteType\">\nSource text\n</i>\n<div class=\"grampsstylednote\">\n<p>\n<strong></strong><span style=\"text-decoration:underline;\"><strong>1855-06-25</strong></span><strong></strong>\n</p>\n<p>\n&nbsp; &nbsp; line 1 &nbsp; &nbsp;fac secunda Junij Baptiza-<br />\n&nbsp; &nbsp; line 2 &nbsp; &nbsp;tus est Lewis Anderson<br />\n&nbsp; &nbsp; line 3 &nbsp; &nbsp;filius legitimus Guillielmus<br />\n&nbsp; &nbsp; line 4 &nbsp; &nbsp;Garner et Elisabetha &nbsp;<br />\n&nbsp; &nbsp; line 5 &nbsp; &nbsp;Becks. Susceptores fuerent<br />\n&nbsp; &nbsp; line 6 &nbsp; &nbsp;petrus Arts et Catharina<br />\n&nbsp; &nbsp; line 7 &nbsp; &nbsp;van de Voorde\n</p>\n</div>\n<i class=\"NoteType\">\nTranscript\n</i>\n<div class=\"grampsstylednote\">\n<p>\n1855-06-25:<br />\nI baptized on June the second Lewis Anderson legitimate son of Guillielmus Garner and Elisabetha Becke. Godparents were petrus Arts and Catharina Van de Voorde\n</p>\n</div>\n</div>",
